import React ,{Component} from 'react';
import Layout from './components/Layout/Layout';
import './App.css';

class App extends Component
{
  render(){
    return(
    <div>
      <Layout>
        <p>Burger</p>
      </Layout>
    </div>
    );
  }
}
export default App;
